    "hint_counter": {                                 "en": "if estimation is used, then maximum power of device is used, otherwise a separete adjustable datapoint can be used ", "de": "Wenn 'Schätzung' verwendet wird, wird die maximale Leistung des Geräts verwendet, andernfalls kann ein separater einstellbarer Datenpunkt verwendet werden.", "ru": "если используется оценка, то используется максимальная мощность устройства, в противном случае можно использовать отдельную регулируемую точку данных", "pt": "se a estimativa for usada, então a potência máxima do dispositivo é usada, caso contrário, um ponto de dados ajustável separado pode ser usado", "nl": "als schatting wordt gebruikt, wordt het maximale vermogen van het apparaat gebruikt, anders kan een afzonderlijk instelbaar datapunt worden gebruikt", "fr": "si l'estimation est utilisée, alors la puissance maximale de l'appareil est utilisée, sinon un point de données réglable séparé peut être utilisé", "it": "se viene utilizzata la stima, viene utilizzata la potenza massima del dispositivo, altrimenti è possibile utilizzare un punto dati regolabile separato", "es": "si se usa la estimación, entonces se usa la potencia máxima del dispositivo; de lo contrario, se puede usar un punto de datos ajustable por separado", "pl": "jeśli używana jest estymacja, używana jest maksymalna moc urządzenia, w przeciwnym razie można użyć oddzielnego regulowanego punktu danych", "uk": "якщо використовується оцінка, то використовується максимальна потужність пристрою, інакше можна використовувати окрему регульовану точку даних", "zh-cn": "如果使用估计，则使用设备的最大功率，否则可以使用单独的可调数据点"},
    "hint_main": {                                    "en": "device name and ID are read-only, change it on overview table if necessary.", "de": "Gerätename und ID sind schreibgeschützt. Ändern Sie sie bei Bedarf in der Übersichtstabelle.", "ru": "имя устройства и идентификатор доступны только для чтения, при необходимости измените их в обзорной таблице.", "pt": "nome e ID do dispositivo são somente leitura, altere-os na tabela de visão geral, se necessário.", "nl": "apparaatnaam en ID zijn alleen-lezen, wijzig deze indien nodig in de overzichtstabel.", "fr": "le nom et l'ID de l'appareil sont en lecture seule, modifiez-les dans le tableau récapitulatif si nécessaire.", "it": "il nome e l'ID del dispositivo sono di sola lettura, modificarli nella tabella panoramica se necessario.", "es": "el nombre del dispositivo y la ID son de solo lectura, cámbielos en la tabla de resumen si es necesario.", "pl": "nazwa urządzenia i identyfikator są tylko do odczytu, w razie potrzeby zmień je w tabeli przeglądowej.", "uk": "ім’я та ідентифікатор пристрою доступні лише для читання, за потреби змініть їх у таблиці огляду.", "zh-cn": "设备名称和 ID 是只读的，如有必要，请在概览表中更改。"},
    "hint_switch": {                                  "en": "if status and switch use two different datapoints, check has OID for switch ", "de": "Wenn Status und Schalter zwei verschiedene Datenpunkte verwenden, stellen Sie sicher, dass eine OID für den Schalter vorhanden ist.", "ru": "если статус и коммутатор используют две разные точки данных, проверьте наличие OID для коммутатора", "pt": "se status e switch usarem dois pontos de dados diferentes, verifique se há OID para switch", "nl": "als status en switch twee verschillende datapunten gebruiken, check heeft OID voor switch", "fr": "si l'état et le commutateur utilisent deux points de données différents, vérifiez l'OID du commutateur", "it": "se status e switch utilizzano due datapoint diversi, controllare has OID per switch", "es": "si el estado y el interruptor usan dos puntos de datos diferentes, verifique que tenga OID para el interruptor", "pl": "jeśli stan i przełącznik używają dwóch różnych punktów danych, sprawdź, czy ma OID dla przełącznika", "uk": "якщо статус і комутатор використовують дві різні точки даних, перевірте наявність OID для комутатора", "zh-cn": "如果状态和开关使用两个不同的数据点，检查开关的 OID"},
